        function initialize() {
            var latlng = [31.887508, -116.3243240];

            $('#my_map').gmap3({
                map: {
                    options: {
                        center: latlng,
                        zoom: 10,
                        mapTypeId: google.maps.MapTypeId.SATELLITE,
                        mapTypeControl: true,
                        mapTypeControlOptions: {
                            style: google.maps.MapTypeControlStyle.DROPDOWN_MENU
                        },
                        navigationControl: true,
                        scrollwheel: true,
                        streetViewControl: false
                    },
                    autofit: {}
                }
            });
            var map = $('#my_map').gmap3("get");
            //agregar el boton que muestra / oculta las millas
            var mostrarocultarmillasDiv = document.createElement('div');
            var mostrarocultarmillasControl = new mostrarocultarmillas(mostrarocultarmillasDiv, map);
            mostrarocultarmillasDiv.index = 1;
            map.controls[google.maps.ControlPosition.TOP_RIGHT].push(mostrarocultarmillasDiv);

            //agregar el boton que indica si se hace autofocus o no
            var autofocusDiv = document.createElement('div');
            var autofocusControl = new autofocus(autofocusDiv, map);
            autofocusDiv.index = 2;
            map.controls[google.maps.ControlPosition.TOP_RIGHT].push(autofocusDiv);

            google.maps.event.addDomListener(window, 'resize', function () {
                var center = map.getCenter();
                google.maps.event.trigger(map, "resize");
                map.setCenter(center);
            });
        }

        function mostrarocultarmillas(controlDiv, map) {

            // Set CSS styles for the DIV containing the control
            // Setting padding to 5 px will offset the control
            // from the edge of the map
            controlDiv.style.padding = '5px';

            // Set CSS for the control border
            var controlUI = document.createElement('div');
            controlUI.style.backgroundColor = 'white';
            controlUI.style.borderStyle = 'solid';
            controlUI.style.borderWidth = '1px';
            controlUI.style.cursor = 'pointer';
            controlUI.style.textAlign = 'Miles';
            controlUI.title = 'show/hide miles';
            controlDiv.appendChild(controlUI);

            // Set CSS for the control interior
            var controlText = document.createElement('div');
            controlText.style.fontFamily = 'Arial,sans-serif';
            controlText.style.color = 'black';
            controlText.style.fontSize = '12px';
            controlText.style.paddingLeft = '4px';
            controlText.style.paddingRight = '4px';
            controlText.innerHTML = 'Show/Hide miles';
            controlUI.appendChild(controlText);

            // Setup the click event listeners: simply set the map to
            google.maps.event.addDomListener(controlUI, 'click', function () {
                if (x == 0) {
                    x = 1;
                    clearMarker('overlay');
                }
                else if (x == 1) {
                    x = 0;
                    drawMiles();
                }
            });
        }

        function autofocus(controlDiv, map) {

            // Set CSS styles for the DIV containing the control
            // Setting padding to 5 px will offset the control
            // from the edge of the map
            controlDiv.style.padding = '5px';

            // Set CSS for the control border
            var controlUI = document.createElement('div');
            controlUI.style.backgroundColor = 'white';
            controlUI.style.borderStyle = 'solid';
            controlUI.style.borderWidth = '1px';
            controlUI.style.cursor = 'pointer';
            controlUI.style.textAlign = 'Track';
            controlUI.title = 'set automatic focus on vehicle';

            controlDiv.appendChild(controlUI);

            // Set CSS for the control interior
            var controlText = document.createElement('div');
            controlText.style.fontFamily = 'Arial,sans-serif';
            controlText.style.color = 'black';
            controlText.style.fontSize = '12px';
            controlText.style.paddingLeft = '4px';
            controlText.style.paddingRight = '4px';
            controlText.innerHTML = 'auto track ON';
            controlUI.appendChild(controlText);

            // Setup the click event listeners: simply set the map to
            google.maps.event.addDomListener(controlUI, 'click', function () {
                if (autof == 0) {
                    autof = 1;
                    controlText.innerHTML = 'auto track ON';
                }
                else if (autof == 1) {
                    autof = 0;
                    controlText.innerHTML = 'auto track OFF';
                }
            });

        }

