        function BindPos() {
            var jqxhr = $.getJSON("http://webapi.branix.com/api/Gps/FE7A7ABE-813E-4184-81E1-2FE016D729D5/Position/0B83B9")
             .done(function (data) {
                 for (i = 0; i < data.totalItemsCount; i++) {
                     createMarker(data.items[i],"icono-7.png");
                 }
             })
            .fail(function () {
                console.log("error");
            });
            jqxhr = null;
            jqxhr = $.getJSON("http://webapi.branix.com/api/Gps/FE7A7ABE-813E-4184-81E1-2FE016D729D5/Position/C64416")
             .done(function (data) {
                 for (i = 0; i < data.totalItemsCount; i++) {
                     createMarker(data.items[i], "icono-21.png");
                     if (autof == 1)
                         $('#my_map').gmap3('get').panTo(new google.maps.LatLng(data.items[i].pos.y, data.items[i].pos.x));
                 }
             })
            .fail(function () {
                console.log("error");
            })

            jqxhr.complete(function () {
                setTimeout(timer, 30000);
            });
        }


        function createMarker(data,imagen) {
            $('#my_map').gmap3({
                clear: {
                    id: data.uid,
                    id: 'o' + data.uid
                }
            });
            var fUTC = new moment('1970-01-01').add('s', data.pos.t);//.format("MM/DD/YYYY HH:mm:ss");
            var dUTC = moment().add('h', 8);//.format("MM/DD/YYYY HH:mm:ss");
            var diferencia = dUTC.diff(fUTC, 'minutes');
            if (diferencia < 10)
            { diferencia = diferencia + ' min ago' }
            else
            { diferencia = '> 10 min' }
            var latlng = [data.pos.y, data.pos.x];
            $('#my_map').gmap3({
                marker: {
                    latLng: latlng, id: data.uid, options: {
                        icon: "images/" + imagen,
                        zIndex: 999999, optimized: true
                    }
                },
               overlay: {
                    id: 'o' + data.uid,
                    latLng: latlng,
                    options: {
                        content: '<div class="infobox">' +
//                        '<img src="images/01.jpg" alt="" /><br/>Tavo Vildosola #21<br/>'+
                        '' + diferencia + '<br/>' +
                        '' + ~~(data.pos.s / 1.609344) + ' mph' +
                        '</div>',
                        offset: {
                            y: -105,
                            x: -35
                        }
                    }
                }
            });
        }

